import logo from './logo.svg';
import './App.css';

const lib = {
  react:{
    name:"React",
    link:"https://reactjs.org"
  },
  angular:{
    name:"Angular",
    link:"https://angular.io"
  }
};

function Component(props){
  return (<a
    className="App-link"
    href={props.link}
    target="_blank"
    rel="noopener noreferrer"
  >
    Learn {props.name}
  </a>)
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p> 
        <Component name="react" link="https://reactjs.org"/>
      </header>
    </div>
  );
}

export default App;
